          "text": "\u0421\u0442\u043e\u0438\u0442 \u0432 \u043f\u043e\u043b\u0435 \u0442\u0435\u0440\u0435\u043c\u043e\u043a. \u0411\u0435\u0436\u0438\u0442 \u043c\u0438\u043c\u043e \u043c\u044b\u0448\u043a\u0430-\u043d\u043e\u0440\u0443\u0448\u043a\u0430. \u0423\u0432\u0438\u0434\u0435\u043b\u0430 \u0442\u0435\u0440\u0435\u043c\u043e\u043a, \u043e\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b\u0430\u0441\u044c \u0438 \u0441\u043f\u0440\u0430\u0448\u0438\u0432\u0430\u0435\u0442:\r\n\u2014 \u0422\u0435\u0440\u0435\u043c-\u0442\u0435\u0440\u0435\u043c\u043e\u043a! \u041a\u0442\u043e \u0432 \u0442\u0435\u0440\u0435\u043c\u0435 \u0436\u0438\u0432\u0435\u0442? \u041d\u0438\u043a\u0442\u043e \u043d\u0435 \u043e\u0442\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f. \u0412\u043e\u0448\u043b\u0430 \u043c\u044b\u0448\u043a\u0430 \u0432 \u0442\u0435\u0440\u0435\u043c\u043e\u043a \u0438 \u0441\u0442\u0430\u043b\u0430 \u0442\u0430\u043c \u0436\u0438\u0442\u044c."
