          "text": "\u0411\u0435\u0436\u0438\u0442 \u043c\u0438\u043c\u043e \u0437\u0430\u0439\u0447\u0438\u043a-\u043f\u043e\u0431\u0435\u0433\u0430\u0439\u0447\u0438\u043a. \u041e\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b\u0441\u044f \u0438 \u0441\u043f\u0440\u0430\u0448\u0438\u0432\u0430\u0435\u0442:\r\n\u2014 \u0422\u0435\u0440\u0435\u043c-\u0442\u0435\u0440\u0435\u043c\u043e\u043a! \u041a\u0442\u043e \u0432 \u0442\u0435\u0440\u0435\u043c\u0435 \u0436\u0438\u0432\u0435\u0442?\r\n\u2014 \u042f, \u043c\u044b\u0448\u043a\u0430-\u043d\u043e\u0440\u0443\u0448\u043a\u0430!\r\n\u2014 \u042f, \u043b\u044f\u0433\u0443\u0448\u043a\u0430-\u043a\u0432\u0430\u043a\u0443\u0448\u043a\u0430!\r\n\u2014 \u0410 \u0442\u044b \u043a\u0442\u043e?\r\n\u2014 \u0410 \u044f \u0437\u0430\u0439\u0447\u0438\u043a-\u043f\u043e\u0431\u0435\u0433\u0430\u0439\u0447\u0438\u043a.\r\n\u2014 \u0418\u0434\u0438 \u043a \u043d\u0430\u043c \u0436\u0438\u0442\u044c!\r\n\r\n\u0417\u0430\u044f\u0446 \u0441\u043a\u043e\u043a \u0432 \u0442\u0435\u0440\u0435\u043c\u043e\u043a! \u0421\u0442\u0430\u043b\u0438 \u043e\u043d\u0438 \u0432\u0442\u0440\u043e\u0435\u043c \u0436\u0438\u0442\u044c."
